import React, {Component} from "react";
import {Form ,Modal ,Col ,Row ,Button} from 'react-bootstrap';

import AddModal from "./addwallet";
import DelModal from "./deleteWallets";

function Wallets()
{
    const [modalShow, setModalShow] = React.useState(false);
    const [modalShow2, setModalShow2] = React.useState(false);


        return (

            <div className="text-center page-holder bg-cover" style={{backgroundColor: '#c2eaba',
                backgroundImage: 'linear-gradient(319deg, #c2eaba 0%, #c5f4e0 37%, #efc2cf 100%)'}}>
                <br/><br/><br/><br/>
                <header>
                    <h1><b> Manage Wallets </b></h1>
                </header>

                <header className="text-center text-white py-5">
                <div className="container">

                                <Button className="btn floatleft btn-xxl"  onClick={() => setModalShow(true)} variant="secondary" size="lg" style={{fontsize:'250px'}}>Add a Wallet</Button>

                                <Button className="btn floatright btn-xxl" onClick={() => setModalShow2(true)} variant="secondary" size="lg" >Delete a Wallet</Button>
                    <AddModal
                        show={modalShow}
                        onHide={() => setModalShow(false)}
                    />
                    <DelModal
                        show={modalShow2}
                        onHide={() => setModalShow2(false)}
                    />

                </div>
                </header>
            </div>
        );


}
export default Wallets;
